import react,{ Component } from "react";
import movie from './data/run_results.json';


class Movies extends Component{
    render(){
        movie.map(val =>(
            <div>
                <img src={val.img}/>
                <h2>{val.name}</h2>
            </div>
        ))
        return <div>{val}</div>
    }
}
export default Movies
